import React, {useContext} from 'react';
import {MovieContex} from './MovieContext';

const Nav = () => {
    const [movies, setMovies] = useContext(MovieContex)
    return (
        <div>
            <h3>Dev Ed</h3>
            <p>List of Movies: {movies.length} </p>
        </div>
    );
  }

  export default Nav;
